      | 36485 -> { ItemTypeData.id= 36485; name= "Men's 'Hephaestus' Shirt (gray/orange)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   This functional but high tech shirt retains the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each shirt is crafted from gray and orange poly fabrics that are extremely durable yet comfortable enough to wear for extended periods.   "; marketGroupId= Some(1398); groupId= 1089; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365315 -> { ItemTypeData.id= 365315; name= "'Neo' Assault A-I"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    A hydra-membrane graft directly integrates the suit with the wearer’s neurological system. While painful, this neuromorphic interface improves processing speed and reaction time while also allowing the suit to draw a limited, renewable supply of energy from the wearer’s body, which in turn can be applied to reinforce shield systems or augment overall power output. Aesthetics are a vital aspect of the suit’s design, because to the Amarr, aesthetics are function. Enshrined within the armor, the wearer becomes a vessel, the embodiment of God’s will and an instrument of holy wrath, unmistakable, and feared, by all who look upon him. To the Amarr, the dropsuit itself is the weapon.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
