      | 54915 -> { ItemTypeData.id= 54915; name= "Drekavac Kybernaut Clade SKIN"; published= true; description= "The Triglavian Collective has not been universally opposed by all in New Eden, with subversive elements across New Eden finding something attractive, even uplifting in Zorya Triglav's message of  proving and joining the flow . The radicals of the Internal Triglavian Revolutionary Organization, also known as  Intriguerre , claim that the Triglavian invasion represents  a dynamic moment of challenge and opportunity for posthumanity . Intriguerre's propagandists have released a ship nanocoating displaying allegiance to the Collective under the name  Kybernaut Clade , in reference to the Triglavian term for capsuleers."; marketGroupId= Some(2519); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 55012 -> { ItemTypeData.id= 55012; name= "Men's Virtuality Biotechnician Coat (OLD)"; published= false; description= "Much medical research in New Eden involves extensive modelling and simulation using virtual environments. Virtuality Biotechnicians specialize in bridging the gap between the real and the virtual in complex fields such as immunology and epidemiology. This work has become increasingly important as the number of highly dangerous pathogens afflicting colonies and various space-industrial locations has multiplied over the decades.    Ideally, the work of Virtuality Biotechnicians seeks to predict the emergence of new biosecurity threats by modelling existing environments and simulating mutation paths the extant biology could take. However, more often than not, virtual biotech investigations must react to developing situations and support remedial work using data provided by emerging pathogen research efforts, such as the Project Discovery Flow Cytometry program."; marketGroupId= Some(1399); groupId= 1088; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 55303 -> { ItemTypeData.id= 55303; name= "Magnate Biosecurity Responders SKIN"; published= true; description= "CONCORD Biosecurity Responders are available to be dispatched on emergency call to any space stations, orbital infrastructure or other space-industrial locations in response to disease and pathogen outbreaks of all kinds.  The challenges of maintaining biosecurity against infectious pathogens and other disease vectors in space-based infrastructure are multiplied by the cosmopolition and highly-interconnected nature of New Eden's space industry and trade networks. This long-recognised problem was for many decades dealt with by the empires, nations and corporations of New Eden in a rather piecemeal fashion, with disputes over jurisdiction and differing standards commonly arising.  Following the Kyonoke Crisis of YC119, and the passage of the interstellar  Hope for All Act , CONCORD established Biosecurity Response Teams, and began to build up its capacity and expertise in the fields of epidemiology and disease management. To that end, CONCORD reached out to partners such as the University of Caille's Department of Epidemiology, Hedion University's School of Medicine, the Sisters of EVE, and the Society of Conscious Thought.  Biosecurity Responders are a vital link in any effort to isolate and analyze infectious pathogens spreading through New Eden's space infrastructure, and crucially to prevent spread to planetary populations. Research to develop effective biosecurity methods, treatments and pathogen controls rely on the field research and data provided by the Biosecurity Reponse Teams."; marketGroupId= Some(2002); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
